import React from 'react';
import TaskInput from './TaskInput';

function TaskList({ tasks, onDelete, onEdit, onComplete }) {
  return (
    <ul className="taskList">
      {tasks.map((task, index) => (
        <li key={index}>
          <input
            type="checkbox"
            className={`complete-checkbox ${task.category}`}
            checked={task.completed}
            onComplete={() => onComplete(index)}
          />
          <label className="taskText">{task.taskInput}</label>
          <button className="edit-button" onClick={() => onEdit(index, TaskInput.text)}>
            Edit
          </button>
          <button className="delete-button" onClick={() => onDelete(index)}>
            Delete
          </button>
        </li>
      ))}
    </ul>
  );
}

export default TaskList;
